pragma solidity 0.7.5;

import "../Vault/Facet.sol";

contract PriceFeedFacet is Facet {
    function latestAnswer() public view returns (int256) {
        return s.answer;
    }

    function latestRound() public view returns (uint80) {
        return s.roundId;
    }

    function setLatestAnswer(int256 _answer) public {
        onlyGov();
        s.roundId = s.roundId + 1;
        s.answer = _answer;
        s.answers[s.roundId] = _answer;
    }

    // returns roundId, answer, startedAt, updatedAt, answeredInRound
    function getRoundData(uint80 _roundId)
        public
        view
        returns (
            uint80,
            int256,
            uint256,
            uint256,
            uint80
        )
    {
        return (_roundId, s.answers[_roundId], 0, 0, 0);
    }
}
